CellularAutomataSystem::CellularAutomataSystem(void) {}
CellularAutomataSystem::~CellularAutomataSystem(void) {}




void CellularAutomataSystem::prevPrevMatReceivePrevMat() {
	for (int i = 0; i < getAcctMatrix_row_lastJ(); i++) {
		for (int j = 0; j < getAcctMatrix_row_lastJ(); j++) {
			prevPrevMatrix.editElement(i, j, prevMatrix.getElement(i, j));
		}
	}
}
void CellularAutomataSystem::prevMatReceiveAcctMat() {
	for (int i = 0; i < getAcctMatrix_row_lastJ(); i++) {
		for (int j = 0; j < getAcctMatrix_row_lastJ(); j++) {
			prevMatrix.editElement(i, j, acctMatrix.getElement(i, j));

		}
	}

}


void CellularAutomataSystem::caculateAcctMatrix(glm::mat4* modelMatrices_aliveCells, glm::mat4* modelMatrices_deadCells, unsigned int* amountAliveCells, unsigned int* amountDeadCells) {
	unsigned int  prevMatrixValue = 0;
	int lastJ = getAcctMatrix_row_lastJ();


	for (int i = 0; i < lastJ; i++) {
		for (int j = 0; j < lastJ; j++) {
			glm::mat4 model;
			prevMatrixValue = prevMatrix.getElement(i, j);

			if (prevMatrixValue == 2) {
				if (isThereExactlyThreeAliveCellulsOnNeighbords(i, j))
				{
					acctMatrix.editElement(i, j, 3);
					model = glm::translate(glm::mat4(1.0f), glm::vec3(i, 0, j));
					modelMatrices_aliveCells[*amountAliveCells] = model;
					(*amountAliveCells)++;
				}
				else
				{
					acctMatrix.editElement(i, j, 2);
					model = glm::mat4(1.0f);
					model = glm::translate(model, glm::vec3(i, 0, j));
					modelMatrices_deadCells[*amountDeadCells] = model;
					(*amountDeadCells)++;
				}
			}
			else if (prevMatrix.getElement(i, j) == 3) {
				if (isThereTwoOrThreeAliveCellulsOnNeighbords(i, j))
				{
					acctMatrix.editElement(i, j, 3);
					model = glm::mat4(1.0f);
					model = glm::translate(model, glm::vec3(i, 0, j));
					modelMatrices_aliveCells[*amountAliveCells] = model;
					(*amountAliveCells)++;
				}
				else {
					acctMatrix.editElement(i, j, 2);
					model = glm::mat4(1.0f);
					model = glm::translate(model, glm::vec3(i, 0, j));
					modelMatrices_deadCells[*amountDeadCells] = model;
					(*amountDeadCells)++;
				}
			}

		}
	}


}

void CellularAutomataSystem::initAllMatrices(unsigned short int dataMapMat_choice) {

	for (int i = 0; i < MAT_N; i++) {
		for (int j = 0; j < MAT_N; j++) {
			switch (dataMapMat_choice) {
			case 1:
				prevMatrix.insertElement(dataMapMat_1[i][j]);
				acctMatrix.insertElement(dataMapMat_1[i][j]);
				prevPrevMatrix.insertElement(dataMapMat_1[i][j]);
				break;
			case 2:
				prevMatrix.insertElement(dataMapMat_2[i][j]);
				acctMatrix.insertElement(dataMapMat_2[i][j]);
				prevPrevMatrix.insertElement(dataMapMat_2[i][j]);
				break;
			}
		}
	}
	acctMatrix.initSquaredMatrixAttrib();
	prevMatrix.initSquaredMatrixAttrib();
	prevPrevMatrix.initSquaredMatrixAttrib();


}
bool CellularAutomataSystem::isStateStable() {
	for (int i = 0; i < (int)acctMatrix.getWidth_column_lastI(); i++) {
		for (int j = 0; j < (int)acctMatrix.getHeight_row_lastJ(); j++) {
			if (acctMatrix.getElement(i, j) != prevPrevMatrix.getElement(i, j))
				return false;
		}
	}
	return true;
}
bool CellularAutomataSystem::isThereExactlyThreeAliveCellulsOnNeighbords(int i, int j) {
	int aliveCelluls = 0;
	if (getValueFromPrevMat(i - 1, j - 1) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i - 1, j) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i - 1, j + 1) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i, j + 1) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i + 1, j + 1) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i + 1, j) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i + 1, j - 1) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i, j - 1) == 3)
		aliveCelluls++;

	if (aliveCelluls == 3)
		return true;
	else
		return false;
}
bool CellularAutomataSystem::isThereTwoOrThreeAliveCellulsOnNeighbords(int i, int j) {
	int aliveCelluls = 0;
	if (getValueFromPrevMat(i - 1, j - 1) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i - 1, j) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i - 1, j + 1) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i, j + 1) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i + 1, j + 1) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i + 1, j) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i + 1, j - 1) == 3)
		aliveCelluls++;
	if (getValueFromPrevMat(i, j - 1) == 3)
		aliveCelluls++;


	if (aliveCelluls == 3 || aliveCelluls == 2)
		return true;
	else
		return false;


}
int CellularAutomataSystem::getValueFromPrevMat(int i, int j) {
	if (i >= 0 && j >= 0 && i < getAcctMatrix_row_lastJ() && j < getAcctMatrix_row_lastJ())
		return prevMatrix.getElement(i, j);
	else
		return 1;
}

unsigned int CellularAutomataSystem::getValueFromAcctMat(int i, int j) {
	return acctMatrix.getElement(i, j);
}

int CellularAutomataSystem::getAcctMatrix_row_lastJ()
{
	return acctMatrix.getHeight_row_lastJ();
}




























